        console.log(info)
    },[])

  return (
    <div>
        {/* {info==='' === <h1>blog</h1>} */}
      {info === 'Users' ? <Users/> : null}
      {info === 'Blogs' ? <Blogs/> : null}
      {info === 'Blog with Name' ? <BlogWithName/> : null}
    </div>
  )
}
